// Get Client Details
function getClientDetails() {
    var clientDetails = {};
    var gr = new GlideRecord('x_ltin2_uw_ai_customer_details');
    gr.orderByDesc('sys_created_on'); // Get the latest record
    gr.query();
    if (gr.next()) {
        clientDetails = {
            "Name": gr.getValue('customer_name'),
            "Address": {
                "Street": gr.getValue('street'),
                "City": gr.getValue('city'),
                "State": gr.getValue('state'),
                "ZipCode": gr.getValue('zip'),
                "Country": gr.getValue('country'),
                "Email": gr.getValue('email_address')
            },
            "SIC": gr.getValue('sic'),
            "NAICS": gr.getValue('naics'),
            "FEIN": gr.getValue('fein'),
            "Revenue": gr.getValue('revenue')
        };
    }
    return clientDetails;
}

// Get Broker Details
function getBrokerDetails() {
    var brokerDetails = {};
    var gr = new GlideRecord('x_ltin2_uw_ai_customer_details');
    gr.orderByDesc('sys_created_on'); // Get the latest record
    gr.query();
    if (gr.next()) {
        brokerDetails = {
            "Name": gr.getValue('agency_name'),
            "ContactName": gr.getValue('contact_name'),
            "ProducerCode": gr.getValue('broker_code')
        };
    }
    return brokerDetails;
}

// Get Location and Building Details
function getLocationDetails() {
    var locations = [];
    var gr = new GlideRecord('x_ltin2_uw_ai_location_cat_perils');
    gr.addQuery('fso_uw_case',inputs.fsocasesysid);
    gr.query();
    while (gr.next()) {
        var location = {
            "Description": gr.getValue('description'),
            "Address": {
                "Street": gr.getValue('street'),
                "City": gr.getValue('city'),
                "State": gr.getValue('state'),
                "ZipCode": gr.getValue('zip'),
                "Country": gr.getValue('country')
            },
            "LocationCoverages": {
                "Coverage": getLocationCoverage(gr.getValue('sys_id'))
            },
            "Buildings": {
                "Building": getBuildings(gr.getValue('sys_id'))
            },
            "_ID": gr.getValue('location_id')
        };
        locations.push(location);
    }
    return locations;
}

// Get Location Coverage
function getLocationCoverage(sys_id) {
    var coverages = [];
    var gr = new GlideRecord('x_ltin2_uw_ai_underwriting_coverage');
    gr.addQuery('fso_case', inputs.fsocasesysid)
    gr.addQuery('attachment', 'Location Level Coverages');
    gr.addQuery('commerical_coverage_location', sys_id);
    gr.query();
    while (gr.next()) {
        coverages.push({
            "CoverageName": gr.getValue('coverage_type'),
            "Limit": gr.getValue('limits'),
            "Deductible": gr.getValue('deductible'),
            "WaitingPeriod": gr.getValue('waiting_period'),
            "CoInsurance": gr.getValue('coinsurance'),
            "LossCause": gr.getValue('loss_cause'),
            "ScheduleModifier": gr.getValue('schedule_modifier'),
            "_ID": gr.getValue('number')
        });
    }
    return coverages;
}

// Get Buildings for a Location
function getBuildings(sys_id) {
    var buildings = [];
    var gr = new GlideRecord('x_ltin2_uw_ai_structure_information');
    gr.addQuery('fso_case', inputs.fsocasesysid)
    gr.addQuery('location_id', sys_id);
    gr.query();
    while (gr.next()) {
        buildings.push({
            "Description": gr.getValue('building_description'),
            "ConstructionType": gr.getValue('construction_type'),
            "ProtectionClass": gr.getValue('protection_class'),
            "OccupancyFactor": gr.getValue('occupancy_factor'),
            "YearBuilt": gr.getValue('year_built'),
            "NoOfStories": gr.getValue('no_of_stories'),
            "FireSprinkler": gr.getValue('fire_sprinkler'),
            "SquareFootage": gr.getValue('building_square_footage'),
            "BuildingCoverages": {
                "Coverage": getBuildingCoverage(gr.getValue('sys_id'))
            },
            "_ID": gr.getValue('building_id')
        });
    }
    return buildings;
}

// Get Building Coverage
function getBuildingCoverage(sys_id) {
    var coverages = [];
    var gr = new GlideRecord('x_ltin2_uw_ai_underwriting_coverage');
    gr.addQuery('fso_case', inputs.fsocasesysid);
    gr.addQuery('attachment', 'Building Level Coverages');
    gr.addQuery('commerical_coverage_location', sys_id);
    gr.addQuery('building_id', sys_id);
    gr.query();
    while (gr.next()) {
        coverages.push({
            "CoverageName": gr.getValue('coverage_type'),
            "Limit": gr.getValue('limits'),
            "Deductible": gr.getValue('deductible'),
            "WaitingPeriod": gr.getValue('waiting_period'),
            "CoInsurance": gr.getValue('coinsurance'),
            "LossCause": gr.getValue('loss_cause'),
            "ScheduleModifier": gr.getValue('schedule_modifier'),
            "_ID": gr.getValue('number')
        });
    }
    return coverages;
}

// Get Policy Details
function getPolicyDetails() {
    var policyDetails = {};
    var gr = new GlideRecord('x_ltin2_uw_ai_fso_uw_case');
    gr.addQuery('sys_id',inputs.fsocasesysid);
    gr.query();
    if (gr.next()) {
        policyDetails = {
            "LineofBusiness": gr.getValue('description'),
            "EffectiveDate": gr.getValue('effective_date'),
            "ExpirationDate": gr.getValue('expiration_date'),
            "PolicyCoverages": {
                "Coverage": getPolicyCoverages()
            }
        };
    }
    return policyDetails;
}

// Get Policy Coverages
function getPolicyCoverages() {
    var coverages = [];
    var gr = new GlideRecord('x_ltin2_uw_ai_underwriting_coverage');
    gr.addQuery('fso_case',inputs.fsocasesysid);
    gr.addQuery('attachment','Policy Level Coverages');
    gr.query();
    while (gr.next()) {
        coverages.push({
            "CoverageName": gr.getValue('coverage_type'),
            "Limit": gr.getValue('limits'),
            "Deductible": gr.getValue('deductible'),
            "WaitingPeriod": gr.getValue('waiting_period'),
            "CoInsurance": gr.getValue('coinsurance'),
            "LossCause": gr.getValue('loss_cause'),
            "ScheduleModifier": gr.getValue('schedule_modifier'),
            "_ID": gr.getValue('number')
        });
    }
    return coverages;
}



})(inputs, outputs);

